import { Link } from "react-router-dom";



function EmpData() {
    const [data,setData]=useState([])
    useEffect(()=>{
        fetch("http://localhost:3005/empData")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
        
            setData(resp)
        })
    },[])
    return (
        <div className="container">
            <div className="card">
                <div className="card-title">
                    <h3>Employe Management System</h3>
                </div>
                <div className="card-body">
                  
                        {/* <Link to="/empform" className="btn btn-success">
                        Add New(+)
                        </Link> */}
                    
                    <table class="table table-bordred">
                        <thead>
                            <tr>
                                <th scope="col">ID</th>
                                <th scope="col">Name</th>
                                <th scope="col">Email</th>
                                <th scope="col">Mobile</th>
                                <th scope="col">City</th>
                            </tr>
                        </thead>
                        <tbody>
                            {/* {data.map((item)=>(
                                <tr>
                                    <td>{item.id}</td>
                                    <td>{item.name}</td>
                                    <td>{item.email}</td>
                                    <td>{item.mobile}</td>
                                    <td>{item.city}</td>
                                </tr> */}


                            {/* ))} */}
                            
                        </tbody>
                    </table>
                </div>
            </div>

        </div>
    )
}

export default EmpData;
